import React, { useState, useEffect } from 'react';
import Header from './components/Header';
import TransitDetail from './components/TransitDetail';
import './css/custom.css';
import truckQuality from './assets/truck-quantity-background.png';
import truckProfit from './assets/truck-profit-background.png';
import transitImage from './assets/truck.png'


function App() {
  const [selectedOption, setSelectedOption] = useState();

  return (
    <div>
        <div>
            <Header callback={setSelectedOption}/>
        </div>           
        <div>
            <TransitDetail
                cost = {162}
                amount = {5652}
                profit = {91} 
                qualityImage = {truckQuality}     
                transitImage = {transitImage}
                profitImage = {truckProfit}
                transitName = {selectedOption}            
            ></ TransitDetail>
        </div>            
    </div>        
  );
}

export default App;
